// 구글 맵
export const MAPS_KEY: string | undefined = process.env.REACT_APP_API_MAP_KEY;
// 네이버 지도
export const LOAD_ADRESS_KEY: string | undefined =
  process.env.REACT_APP_API_LOAD_ADRESS_KEY;
// 한국 개발자 지원 도로명 주소
export const ADDRESS_API_KEY: string | undefined =
  process.env.REACT_APP_API_ADDRESS_API_KEY;
